‚Å†
Mendez grew up during a time when most southern and southwestern schools were segregated. In the case of California, Hispanics were not allowed to attend schools that were designated for "Whites" only and were sent to the so-called "Mexican schools." Mendez was denied enrollment to a "Whites" only school, an event which prompted her parents to take action and together organized various sectors of the Hispanic community who filed a lawsuit in the local federal court. The success of their action, of which Sylvia was the principal catalyst, would eventually bring to an end the era of segregated education. She was awarded the Presidential Medal of Freedom, the United States' highest civilian honor, on February 15, 2011.‚Å†
‚Å†
Mendez became a nurse and retired after working for thirty years in her field. She adopted two girls and lives in Fullerton, California. She travels and gives lectures to educate others on the historic contributions made by her parents and the co-plaintiffs to the desegregation effort in the United States. The success of the Mendez v. Westminster case made California the first state in the nation to end segregation in school, paving the way for better-known Brown vs. Board of Education seven years later, which would bring an end to school segregation in the entire country.‚Å†
‚Å†
